import '../App.css';
import React, { useState, useEffect } from 'react';
import tabsolute from '../images/tabsolutelogo2.png';

class WeatherStatus extends React.Component {
    constructor(props) {
        super(props);
        this.state = ({
            temp: ""
        });
    }

    componentDidMount() {
        const WEATHER_API_KEY = `${process.env.REACT_APP_WEATHER_API_KEY}`
        fetch('https://api.openweathermap.org/data/2.5/weather?q=' + 'toronto' + '&units=metric&appid=' + WEATHER_API_KEY)
		    .then(res => res.json())
            .then(
            (result) => {
                console.log(result);
                this.setState({
                    temp: result.main.temp
                })
		    },
            (error) => {
                console.log("error")
            }
        )
    }

    render() {
        return(
            <div style={{float: 'right'}}>
                <p>{this.state.temp}</p>
            </div>
        )
    }
}

export default WeatherStatus;
